import React from 'react';
import { AppBar, Toolbar, Typography, IconButton } from '@mui/material';
import { Link } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import logo from '../assets/logo.webp';

const Navbar = () => {
    return (
        <AppBar position="static">
            <Toolbar>
                <IconButton edge="start" color="inherit" aria-label="menu">
                    <MenuIcon />
                </IconButton>
                <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                    <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
                        <img src={logo} alt="Grimoires Guardians" style={{ height: '40px', marginRight: '10px' }} />
                        Grimoires Guardians
                    </Link>
                </Typography>
                <Link to="/chat" style={{ textDecoration: 'none', color: 'inherit', marginRight: '10px' }}>
                    Chat
                </Link>
                <Link to="/test-connection" style={{ textDecoration: 'none', color: 'inherit' }}>
                    Test Connection
                </Link>
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
